Team @risereigntraining - I had to make a separate post for us because ... 

We live this mission.  We love it. We do it every day. We get out there. We put in the work. We understand our coach's expectations and our own expectations and you showed up today to run your hearts out.  Man. I'm so proud to be a Rise & Reign athlete & teammate.  I'm so proud of our coaches who both ran today.  I'm so proud to see you out there along the blue line running & cheering. 

What a day to be alive. 

